SQL:
SELECT Phone 
FROM public.schools 
WHERE Charter = 1 AND FundingType = 'Direct' AND OpenDate > '2000-01-01';

SELECT "CDSCode" 
FROM public.frpm 
WHERE "Enrollment (K-12)" > 500;

SELECT COUNT(*)
FROM public.satscores
WHERE "dname" = 'Alameda' AND "NumTstTakr" < 100;

SELECT account_id 
FROM public.account 
WHERE frequency = 'monthly';

SELECT COUNT(*) 
FROM atom 
WHERE element != 'bromine';

SELECT atom_id, atom_id2
FROM public.connected
WHERE bond_id = 'TR000_2_5';

SELECT bond_id
FROM public.connected
WHERE atom_id2 = 'TR000_2';

SELECT COUNT(*) AS connection_count
FROM public.connected
WHERE atom_id = '19' OR atom_id2 = '19';

SELECT * 
FROM public.cards
WHERE "isFullArt" = 1 AND "hasFoil" = 0;

SELECT name 
FROM public.cards 
WHERE faceConvertedManaCost > convertedManaCost;

SELECT name 
FROM public.cards 
WHERE frameVersion = '2015' AND edhrecRank < 100;

SELECT COUNT(DISTINCT type) AS card_types_count
FROM public.cards
WHERE artist = 'Aaron Boyd';

SELECT keywords 
FROM public.cards 
WHERE name = 'Angel of Mercy';

SELECT "promoTypes" 
FROM public.cards 
WHERE name = 'Duress';

SELECT "originalType" 
FROM public.cards 
WHERE name = 'Ancestor''s Chosen';

SELECT text 
FROM public.rulings 
WHERE uuid = (SELECT uuid FROM public.cards WHERE "asciiName" = 'Benalish Knight');

SELECT DISTINCT artist 
FROM public.cards 
WHERE "asciiName" = 'Phyrexian';

SELECT COUNT(*) 
FROM public.cards 
WHERE toughness = '99';

SELECT name 
FROM public.cards 
WHERE artist = 'Aaron Boyd';

SELECT id 
FROM public.cards 
WHERE "duelDeck" = 'a';

SELECT edhrecRank 
FROM public.cards 
WHERE "frameVersion" = '2015';

SELECT "DisplayName"
FROM public.users
WHERE EXTRACT(YEAR FROM "CreationDate") = 2011;

SELECT COUNT(*) 
FROM public.users 
WHERE "LastAccessDate" > '2014-09-01';

SELECT COUNT(*) 
FROM public.users 
WHERE UpVotes > 100 AND DownVotes > 1;

SELECT COUNT(*) 
FROM public.users 
WHERE Views > 10 AND CreationDate > '2013-12-31';

SELECT "OwnerDisplayName"
FROM public.posts
WHERE "Title" = 'Eliciting priors from experts';

SELECT SUM(CommentCount) AS TotalComments
FROM posts
WHERE OwnerDisplayName = 'csgillespie';

SELECT MAX(AnswerCount) AS MostAnswers
FROM posts
WHERE OwnerDisplayName = 'csgillespie';

SELECT p."LastEditorDisplayName"
FROM public.posts p
WHERE p."Title" = 'Examples for teaching: Correlation does not mean causation';

SELECT COUNT(*) AS root_post_count
FROM posts
WHERE OwnerDisplayName = 'csgillespie' AND ParentId IS NULL;

SELECT COUNT(*) AS vote_count
FROM votes
WHERE UserId = 58 AND CreationDate = '2010-07-19';

SELECT COUNT(*) 
FROM public.badges 
WHERE "Name" = 'Revival';

SELECT p.Id, p.ViewCount, p.CommentCount
FROM public.posts p
WHERE p.ViewCount = 1910;

SELECT "ViewCount"
FROM public.posts
WHERE "Title" = 'Integration of Weka and/or RapidMiner into Informatica PowerCenter/Developer';

SELECT "DisplayName" 
FROM public.users 
WHERE "WebsiteUrl" = 'http://stackoverflow.com';

SELECT UserDisplayName 
FROM public.comments 
WHERE Text = 'thank you user93!';

SELECT AVG(height_cm) AS average_height
FROM public.superhero
WHERE publisher_id = (SELECT id FROM public.publisher WHERE name = 'Marvel Comics');

SELECT COUNT(*) 
FROM public.superhero
WHERE publisher_id = (SELECT id FROM public.publisher WHERE publisher_name = 'DC Comics');

SELECT COUNT(*) AS vampire_superheroes_count
FROM public.superhero
JOIN public.hero_attribute ON public.superhero.id = public.hero_attribute.hero_id
WHERE public.hero_attribute.attribute_id = (
    SELECT id FROM public.superpower WHERE power_name = 'vampire'
);

SELECT COUNT(*) AS total_superheroes_without_full_name
FROM public.superhero
WHERE full_name IS NULL OR full_name = '';

SELECT COUNT(*) 
FROM public.superhero 
WHERE alignment_id = (SELECT id FROM public.alignment WHERE alignment = 'bad');

SELECT url 
FROM public.circuits 
WHERE name = 'Circuit de Barcelona-Catalunya';

SELECT MIN(year) AS first_singapore_gp_year
FROM races
WHERE name ILIKE '%Singapore Grand Prix%';

SELECT AVG(height) AS average_height
FROM public."Player"
WHERE birthday BETWEEN '1990-01-01' AND '1995-12-31';

SELECT DISTINCT team_fifa_api_id 
FROM public."Team_Attributes"
WHERE "buildUpPlaySpeed" > 50 AND "buildUpPlaySpeed" < 60;

SELECT team_short_name 
FROM public."Team" 
WHERE team_long_name = 'Queens Park Rangers';

SELECT player_name
FROM public."Player"
WHERE birthday LIKE '1970-10-%';

SELECT player_name 
FROM public."Player" 
WHERE height > 180;

SELECT COUNT(*) 
FROM public."Player" 
WHERE birthday > '1990-12-31';

SELECT COUNT(*) 
FROM public."Player"
WHERE player_name LIKE 'Adam%' AND weight > 170;

SELECT player_name, height 
FROM public."Player" 
WHERE height = (SELECT MIN(height) FROM public."Player");

SELECT "ANA" 
FROM public."Examination" 
WHERE "ID" = 3605340 AND "Examination Date" = '1996-12-02';

SELECT "T-CHO"
FROM public."Laboratory"
WHERE "ID" = 2927464 AND "Date" = '1995-09-04';

SELECT "ID"
FROM public."Patient"
WHERE "SEX" = 'female' AND EXTRACT(YEAR FROM "Birthday") = 1964 AND "Admission" IS NOT NULL;

SELECT "First Date", "Diagnosis"
FROM public."Patient"
WHERE "ID" = 48473;

SELECT COUNT(*) AS Female_APS_Patients_Count
FROM public."Patient"
WHERE "SEX" = 'Female' AND "Diagnosis" = 'APS';

SELECT SUM(amount) AS total_amount_received
FROM public.income
WHERE source = 'Vice President';

SELECT expense_id, expense_description, approved
FROM public.expense
WHERE expense_date = '2019-10-08' AND expense_description = 'October Meeting';

SELECT location 
FROM public.event 
WHERE event_name = 'Spring Budget Review';

SELECT cost 
FROM public.expense 
WHERE expense_description = 'Posters' AND expense_date = '2019/9/4';

SELECT notes 
FROM public.event 
WHERE event_name = 'fundraising' AND event_date = '2019/9/14';

SELECT COUNT(*) AS total_majors
FROM public.major
WHERE college = 'College of Humanities and Social Sciences';

SELECT phone 
FROM public.member 
WHERE first_name = 'Carlo' AND last_name = 'Jacobs';

SELECT COUNT(*) AS exceeded_budget_count
FROM budget
WHERE link_to_event = 'November Meeting' AND spent > amount;

SELECT 
    (SELECT COUNT(*) FROM public.customers WHERE "Currency" = 'EUR')::FLOAT /
    (SELECT COUNT(*) FROM public.customers WHERE "Currency" = 'CZK')::FLOAT AS eur_to_czk_ratio;

SELECT MAX(Consumption) AS highest_monthly_consumption
FROM public.yearmonth
WHERE Date LIKE '2012%';

SELECT AVG(Price) AS AveragePrice
FROM public.transactions_1k
WHERE Date BETWEEN '2012-01-01' AND '2012-01-31';

SELECT "ProductID" 
FROM public.transactions_1k 
WHERE "Date" = '2012-08-23' AND "Time" = '21:20:00';
